import React from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import ChartImage from "../assets/chart.png"; 

export default function Intrestpage({ progressBarWidth }) {
    const CardContents = [
        {
          image:ChartImage,
          description:"Student or soon to be enrolled",
        },
        {
            image:ChartImage,
            description:"Learning Specific skills to advance my career",
          },
    ]
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        width: "80%", // Set width to 80%
        margin: "auto", // Center the container
      }}
    >
      <div style={{ width: "100%" }}>
        <p
          style={{
            fontFamily: "Roboto",
            fontSize: 22,
            fontWeight: "bold",
            textAlign: "center",
          }}
        >
         Which describes you best?
        </p>
        <p
          style={{
            fontFamily: "Roboto",
            textAlign: "center",
          }}
        >
          Choose just one. This will help us get you started (but won't limit
          your experience).
        </p>
      </div>
      <div style={{ display: "flex" }}>
        <Card
          variant="outlined"
          style={{
            height: "70px",
            width: progressBarWidth,
            marginTop: 20,
          }}
        >
          {/* Adjust the height as needed */}
          <CardContent style={{ display: "flex", alignItems: "center" }}>
            <img
              src={ChartImage}
              alt="Chart"
              style={{ marginRight: "10px", width: "50px", height: "35px" }}
            />{" "}
            {/* Displaying the image */}
            <div>
              <Typography component="div">
                Learning Specific skills to advance my career
              </Typography>
            </div>
          </CardContent>
        </Card>
      </div>
    </div>
  );
}
